                "cmt": "\n<b>Description</b> name=Chemin Navarrais \ncmt=Entre Saint-Jean Pied de Port et Saint-Jacques de Compostelle. \n \n\"L'itinéraire est très bien équipé en hébergements. \n \nIl est abondamment balisé par une multitude de signes, panneaux, flèches et autres marques. \n \nLa fréquentation y est importante et constitue elle aussi une sorte de balisage visuel du chemin. Ce dernier est en effet peuplé de nombreux marcheurs et cyclistes, notamment en été et sur les 100 derniers kilomètres.\" \n(ACIR, http://www.chemins-compostelle.com/itineraires/43/le-camino-frances) \n \nVoir les profils détaillés: \nhttp://www.aucoeurduchemin.org/spip/IMG/pdf/profil_d_etapes_voir.pdf \ndesc=Entre Saint-Jean Pied de Port et Saint-Jacques de Compostelle. \n \n\"L'itinéraire est très bien équipé en hébergements. \n \nIl est abondamment balisé par une multitude de signes, panneaux, flèches et autres marques. \n \nLa fréquentation y est importante et constitue elle aussi une sorte de balisage visuel du chemin. Ce dernier est en effet peuplé de nombreux marcheurs et cyclistes, notamment en été et sur les 100 derniers kilomètres.\" \n(ACIR, http://www.chemins-compostelle.com/itineraires/43/le-camino-frances) \n \nVoir les profils détaillés: \nhttp://www.aucoeurduchemin.org/spip/IMG/pdf/profil_d_etapes_voir.pdf \ntime=2017-01-22T21:55:22Z  \n<b>Distance</b> 772.3 km  \n",
